import React from 'react'

const CreateStudent = () => {
  return (
    <div className='container'>
      <h2>Add New Student</h2>
      <form>
        <label htmlFor='id'>ID:</label>
        <input type='text' id='id' name='id'/>
      </form>

      
    </div>
  )
}

export default CreateStudent
